import React from "react"
import IndexSlider from "./ImageSilder"
import IndexMenu from "./Indexmenu"
import "./index.scss"
import { foodmenu } from "../utlis/data"

const Index = () => {
  let num = 1
  const indexChanger = () => {
    for (let index = 0; (index = foodmenu.length + 1); index++) {
      if ((index = foodmenu.length)) {
        num = 0
      } else {
        num++
      }
    }
    return num
  }
  const changeNum = () => {
    setInterval(indexChanger, 1000)
  }
  return (
    <div className="index">
      {console.log(setInterval(indexChanger, 1000))}
      <div className="index-slider">
        {/* foodmenu.map(item => (
          <IndexSlider link={item.img} alt={item.alt} />
        )) */}
        <div className="slider-hero">
          <IndexSlider link={foodmenu[0]} />
        </div>
      </div>
      <div className="index-menu">
        <IndexMenu />
      </div>
    </div>
  )
}

export default Index
